class Solution {
    func goodSubsetofBinaryMatrix(_ grid: [[Int]]) -> [Int] {
        let rowCount = grid.count
        let colCount = grid[0].count

        // Helper function to check if a subset is good
        func isGoodSubset(rows: [Int]) -> Bool {
            let subsetLength = rows.count
            for col in 0..<colCount {
                let sum = rows.reduce(0) { $0 + grid[$1][col] }
                if sum > subsetLength / 2 {
                    return false
                }
            }
            return true
        }

        // Generate all possible subsets
        for subsetSize in 1...rowCount {
            var subset = Array(repeating: 0, count: subsetSize)
            var i = 0

            // Initial subset of size `subsetSize`
            while i < subsetSize { subset[i] = i; i += 1 }

            // Iterate through all combinations of subsets of size `subsetSize`
            var hasMore = true
            while hasMore {
                if isGoodSubset(rows: subset) {
                    return subset
                }

                // Generate next subset in lexicographic order
                i = subsetSize - 1
                hasMore = false
                while i >= 0 {
                    if subset[i] != i + rowCount - subsetSize {
                        hasMore = true
                        break
                    }
                    i -= 1
                }

                if hasMore {
                    subset[i] += 1
                    for j in i + 1..<subsetSize {
                        subset[j] = subset[j - 1] + 1
                    }
                }
            }
        }

        // If no good subset is found
        return []
    }
}
